import './App.css';
import Register from './component/Registeration';
import {useState} from 'react'
import SignIn from './component/SignIn';

function App() {
  const [State,setState] = useState("Register");
  const ChangeState =(StateValue) =>
  {
    setState(StateValue);
  }

  return (
    <div className="main-box">
      { State == "Register" &&
        <Register IsRegister={ChangeState} Email ="Email"></Register>
      }
      {State == "SignIn" &&
        <SignIn click={()=>setState("SignIn")}></SignIn>
      }

    </div>
  );
}
export default App;
